This sample shows how to call GetPartyAsync and parse the result.

Uri endpoint = new Uri("<https://my-service.azure.com>");
TokenCredential credential = new DefaultAzureCredential();
Parties client = new FarmBeatsClient(endpoint, credential).GetPartiesClient(apiVersion: "2022-11-01-preview");

Response response = await client.GetPartyAsync("<partyId>", null);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());

